import * as axs from './axs';

export const profileAction = (profile) => async (dispatch) => {
    try{
        const {data} = await axs.profileApi(profile);


        dispatch ({type: 'PROFILE', payload: data});
    } catch(error) {
        console.log(error);
    }
}
